import React, {Component, Fragment} from 'react';
import {Button, Col, Container, Row} from "react-bootstrap";

class NavMenuMobile extends Component {
    render() {
        return (
            <Fragment>
                <Container fluid={true} className="p-2 fixed-top bg-light shadow-sm ">
                    <Row>
                        <Col className="p-0" lg={12} md={4} sm={12} xs={12}>

                            <Button className="btn"><i className="fa fa-bars"></i></Button>
                        </Col>



                    </Row>
                </Container>

                <div id="SideNavID" className="sideNavOpen">
                    <hr className="w-70"/>
                    <div className="list-group-item nav-font nav-itemmenu list-group-item-action" href=''></div>
                </div>

                <div className="ContentOverlayOpen">

                </div>

            </Fragment>
        );
    }
}

export default NavMenuMobile;
